void addInventTransJoinSource()
{
    FormBuildDataSource dsInventTransOrigin;

    if (customJournalType == CustomJournalType_RU::Export)
    {
        dsInventTransOrigin = element.form().dataSource(inventTransOriginDSNo);
        switch (invoicePostingType)
        {
            case SalesInvoicePostingType_RU::Standard :
                dsInventTransOrigin.joinSource(tablestr(CustPackingSlipTrans));
                break;
            case SalesInvoicePostingType_RU::GoodsInRoute :
                dsInventTransOrigin.joinSource(tablestr(CustInvoiceTrans));
                break;
        }

        dsInventTransOrigin.linkType(FormLinkType::InnerJoin);
    }
}

void adjustDesign()
{
    tabPageCustPackingSlip.visible(customJournalType    == CustomJournalType_RU::Export &&
                                   invoicePostingType   == SalesInvoicePostingType_RU::Standard);

    tabPageCustInvoice.visible(customJournalType    == CustomJournalType_RU::Export &&
                               invoicePostingType   == SalesInvoicePostingType_RU::GoodsInRoute);

    tabPagePurch.visible(customJournalType       == CustomJournalType_RU::Import &&
                         customInventTransStatus == CustomInventTransStatus_RU::Ordered);

    tabPageVendInvoice.visible(customJournalType        == CustomJournalType_RU::Import &&
                               customInventTransStatus  == CustomInventTransStatus_RU::Purchased);
}

