NoYes editMark(boolean              _set,
               Common               _line,
               Num                  _id,
               ItemId               _itemId,
               LineNum              _lineNum,
               TransDate            _transDate,
               FormDataSource       _lineDataSource,
               NoYes                _mark,
               UnitOfMeasureSymbol  _unitId)
{
    NoYes            mark;
    TmpFrmVirtual    tmpFrmVirtualLine;
    Object           lineDataSource = _lineDataSource;

    customJournalTransCreate.findTmpFrmVirtualLine(_line.TableId, _line.RecId);

    tmpFrmVirtualLine = customJournalTransCreate.getTmpFrmVirtualLine();

    if (tmpFrmVirtualLine)
    {
        mark = NoYes::Yes;
    }

    if (_set)
    {
        if (_mark)
        {
            if (! formDataSourceHasMethod(lineDataSource, identifierstr(qtyAvailable)))
            {
                throw error("@SYS109465");
            }

            if (! formDataSourceHasMethod(lineDataSource, identifierstr(pdsCWQtyAvailable)))
            {
                throw error("@SYS109465");
            }

            if (element.validateQty(lineDataSource.qtyAvailable(_line, false), lineDataSource, _line, _unitID, lineDataSource.pdsCWQtyAvailable(_line, false)))
            {
                customJournalTransCreate.writeTmpFrmVirtualLine(_line.TableId,
                                                                _line.RecId,
                                                                _id,
                                                                _itemId,
                                                                _lineNum,
                                                                _transDate,
                                                                lineDataSource.qtyAvailable(_line, false),
                                                                lineDataSource.pdsCWQtyAvailable(_line, false));

                mark = NoYes::Yes;
            }
        }
        else
        {
            tmpFrmVirtualLine.delete();
            mark = NoYes::No;
        }
    }

    return mark;
}

NoYes editMarkAll(boolean           _set,
                  Common            _header,
                  Num               _id,
                  NoYes             _markAll,
                  FormDataSource    _lineDataSource)
{
    Object           lineDataSource = _lineDataSource;
    TmpFrmVirtual    tmpFrmVirtualHeader;
    QueryRun         queryRun;
    NoYes            markAll;

    customJournalTransCreate.findTmpFrmVirtualHeader(_header.TableId, _header.RecId);

    tmpFrmVirtualHeader = customJournalTransCreate.getTmpFrmVirtualHeader();

    if (tmpFrmVirtualHeader)
    {
        markAll = NoYes::Yes;
    }

    if (_set)
    {
        queryRun = new QueryRun(_lineDataSource.query());

        if (_markAll)
        {
            customJournalTransCreate.writeTmpFrmVirtualHeader(_header.TableId,
                                                              _header.RecId,
                                                              _id);

            markAll = NoYes::Yes;

            if (! formDataSourceHasMethod(lineDataSource, identifierstr(marked)))
            {
                throw error("@SYS109465");
            }

            while (queryRun.next())
            {
                lineDataSource.marked(true, queryRun.get(_lineDataSource.table()), true);
            }

            _lineDataSource.executeQuery();
        }
        else
        {
            tmpFrmVirtualHeader.delete();

            markAll = NoYes::No;

            if (! formDataSourceHasMethod(lineDataSource, identifierstr(marked)))
                throw error("@SYS109465");

            while (queryRun.next())
            {
                lineDataSource.marked(true, queryRun.get(_lineDataSource.table()), false);
            }

            _lineDataSource.executeQuery();

        }
    }

    return markAll;
}

container editQtyPacked(boolean             _set,
                        Common              _line,
                        Num                 _id,
                        ItemId              _itemId,
                        LineNum             _lineNum,
                        TransDate           _transDate,
                        FormDataSource      _lineDataSource,
                        Qty                 _qty,
                        UnitOfMeasureSymbol _unitID,
                        PdsCWInventQty      _pdsCWQty = 0.0)
{
    Qty              qty, newQty, availableQty;
    PdsCWInventQty   pdsCWQty, pdsCWAvailableQty;
    boolean          availableQtyCalculated, pdsCWAvailableQtyCalculated;
    boolean          checkQtyCorrelation = true;
    TmpFrmVirtual    tmpFrmVirtualLine;
    Object           lineDataSource = _lineDataSource;

    Qty              calculateAvailableQty()
    {
        if (availableQtyCalculated)
        {
            return availableQty;
        }

        if (! formDataSourceHasMethod(lineDataSource, identifierstr(qtyAvailable)))
        {
            throw error("@SYS109465");
        }

        availableQty = lineDataSource.qtyAvailable(_line);
        availableQtyCalculated = true;

        return availableQty;
    }

    PdsCWInventQty   calculatePdsCWAvailableQty()
    {
        if (pdsCWAvailableQtyCalculated)
        {
            return pdsCWAvailableQty;
        }

        if (! formDataSourceHasMethod(lineDataSource, identifierstr(pdsCWQtyAvailable)))
        {
            throw error("@SYS109465");
        }

        pdsCWAvailableQty = lineDataSource.pdsCWQtyAvailable(_line);
        pdsCWAvailableQtyCalculated = true;

        return pdsCWAvailableQty;
    }

    boolean          validateQty(Qty _qty2Validate, PdsCWInventQty _pdsCWQty2Validate)
    {
        boolean qtyIsValid = element.validateQty(_qty2Validate, _lineDataSource, _line, _unitID, _pdsCWQty2Validate, checkQtyCorrelation);
        if (qtyIsValid && checkQtyCorrelation)
        {
            if (!availableQtyCalculated)
            {
                calculateAvailableQty();
            }

            if (!pdsCWAvailableQtyCalculated)
            {
                calculatePdsCWAvailableQty();
            }

            if (abs(_qty2Validate) < abs(availableQty) || abs(_pdsCWQty2Validate) < abs(pdsCWAvailableQty))
            {
                PdsCatchWeight::validateInventQty(_itemId, availableQty - _qty2Validate, pdsCWAvailableQty - _pdsCWQty2Validate);
            }
        }
        return qtyIsValid;
    }

    customJournalTransCreate.findTmpFrmVirtualLine(_line.TableId, _line.RecId);

    tmpFrmVirtualLine = customJournalTransCreate.getTmpFrmVirtualLine();

    if (tmpFrmVirtualLine)
    {
        qty = tmpFrmVirtualLine.Qty;
        pdsCWQty = tmpFrmVirtualLine.PdsCWQty;
    }
    else
    {
        qty = calculateAvailableQty();
        pdsCWQty = calculatePdsCWAvailableQty();
    }

    if (_set)
    {
        if (_pdsCWQty != pdsCWQty && PdsGlobal::pdsIsCWItem(_itemId))
        {
            if (!pdsCWAvailableQtyCalculated)
            {
                calculatePdsCWAvailableQty();
            }

            if (_pdsCWQty == pdsCWAvailableQty)
            {
                if (!availableQtyCalculated)
                {
                    calculateAvailableQty();
                }

                newQty = availableQty;
                checkQtyCorrelation = false;
            }
            else
            {
                newQty = PdsCatchWeight::inventQty(_itemId, _pdsCWQty);
            }
        }
        else
        {
            newQty = _qty;
            if (PdsGlobal::pdsIsCWItem(_itemId))
            {
                if (!pdsCWAvailableQtyCalculated)
                {
                    calculatePdsCWAvailableQty();
                }

                if (_pdsCWQty == pdsCWAvailableQty)
                {
                    if (!availableQtyCalculated)
                    {
                        calculateAvailableQty();
                    }

                    newQty = availableQty;
                    checkQtyCorrelation = false;
                }
            }
        }

        if (validateQty(newQty, _pdsCWQty))
        {
            qty = newQty;
            pdsCWQty = _pdsCWQty;

            if (! tmpFrmVirtualLine)
            {
                if (! formDataSourceHasMethod(lineDataSource, identifierstr(marked)))
                {
                    throw error("@SYS109465");
                }

                lineDataSource.marked(true, _line, true);
            }

            customJournalTransCreate.writeTmpFrmVirtualLine(_line.TableId,
                                                            _line.RecId,
                                                            _id,
                                                            _itemId,
                                                            _lineNum,
                                                            _transDate,
                                                            qty,
                                                            pdsCWQty);
        }
    }

    return [qty, pdsCWQty];
}

public void init()
{
    if (! element.args().caller() ||
        ! SysDictClass::isEqualOrSuperclass(classidget(element.args().caller()), classnum(DialogRunbase)) ||
        ! SysDictClass::isEqualOrSuperclass(classidget(element.args().caller().runbase()), classnum(CustomJournalTransCreate_RU)))
    {
        throw error(strfmt("@SYS86720", this.name(), classstr(CustomJournalTransCreate_RU)));
    }

    customJournalTransCreate    = element.args().caller().runbase();
    customJournalTable          = customJournalTransCreate.parmCustomJournalTable();
    customJournalType           = customJournalTable.CustomJournalType;
    customInventTransStatus     = customJournalTable.CustomInventTransStatus;
    invoicePostingType          = customJournalTable.InvoicePostingType;

    element.addInventTransJoinSource();

    super();

    element.updateQuery();
    element.adjustDesign();

    qtyAvailableMap = new Map(Types::Container, Types::Container);
}

RunBase runBase()
{
    return customJournalTransCreate;
}

void updateQuery()
{
    Query                   query;
    QueryBuildDataSource    qbdsTable;
    QueryBuildDataSource    qbdsPurchTable_RU;
    QueryBuildDataSource    qbdsInventTrans;
    QueryBuildDataSource    qbdsInventTransOrigin;
    QueryBuildDataSource    qbdsInventDim;

    QueryBuildRange         linkRange;

    str                     rangeValueReceipt;
    str                     rangeValueIssue;
    RecId                   dimAttrRecId = AgreementHeaderExt_RU::getAgreementDimensionAttribute();

    void setInventTransRange(boolean _noGroupRef = false, boolean _noReturnInventTrans = false)
    {
        qbdsInventTrans.addRange(fieldnum(InventTrans, StatusReceipt)).value(rangeValueReceipt ? rangeValueReceipt : SysQuery::valueEmptyString());
        qbdsInventTrans.addRange(fieldnum(InventTrans, StatusIssue)).value(rangeValueIssue ? rangeValueIssue : SysQuery::valueEmptyString());
        qbdsInventTrans.addRange(fieldnum(InventTrans, ReturnInventTransOrigin)).value(SysQuery::valueEmptyString());

        if (_noGroupRef)
        {
            qbdsInventTrans.addRange(fieldnum(InventTrans, GroupRefType_RU)).value(queryValue(InventTransGroupRefType_RU::None));
        }

        if (_noReturnInventTrans)
        {
            qbdsInventTrans.addRange(fieldnum(InventTrans, ReturnInventTransOrigin)).value(queryValue(0));
        }
    }

    void addInventTransSource(QueryBuildDataSource _parentDataSource, fieldId _parentField)
    {
        qbdsInventTransOrigin = _parentDataSource.addDataSource(tablenum(InventTransOrigin));
        qbdsInventTransOrigin.addLink(_parentField, fieldnum(InventTransOrigin, InventTransId));
        qbdsInventTransOrigin.joinMode(JoinMode::ExistsJoin);

        qbdsInventTrans = qbdsInventTransOrigin.addDataSource(tablenum(InventTrans));
        qbdsInventTrans.addLink(fieldnum(InventTransOrigin, RecId), fieldnum(InventTrans, InventTransOrigin));
        qbdsInventTrans.joinMode(JoinMode::ExistsJoin);

        setInventTransRange();
    }

    void addInventDimSource(QueryBuildDataSource _parentDataSource, fieldId _parentField)
    {
        qbdsInventDim = _parentDataSource.addDataSource(tablenum(InventDim));
        qbdsInventDim.addLink(_parentField, fieldnum(InventDim, InventDimId));
        qbdsInventDim.joinMode(JoinMode::ExistsJoin);

        qbdsInventDim.addRange(fieldnum(InventDim, InventGtdId_RU)).value(SysQuery::valueEmptyString());
    }

    void addPartnerInventRanges(FormDataSource  _dsJour,
                                FormDataSource  _dsTrans,
                                tableId         _jourTableId,
                                tableId         _transTableId,
                                fieldId         _accountFieldId,
                                fieldId         _inventTransIdFieldId)
    {
        qbdsTable = _dsJour.query().dataSourceTable(_jourTableId);
        qbdsTable.addRange(_accountFieldId).value(queryValue(customJournalTable.PartnerCode));

        addInventTransSource(_dsTrans.query().dataSourceTable(_transTableId), _inventTransIdFieldId);

        qbdsTable = qbdsTable.addDataSource(_transTableId);
        qbdsTable.relations(true);
        qbdsTable.joinMode(JoinMode::ExistsJoin);
        addInventTransSource(qbdsTable, _inventTransIdFieldId);
    }

    void addPartnerInventAgreementRanges(FormDataSource  _dsJour,
                                         FormDataSource  _dsTrans,
                                         tableId         _jourTableId,
                                         tableId         _transTableId,
                                         fieldId         _accountFieldId,
                                         fieldId         _inventTransIdFieldId,
                                         fieldId         _agreementFieldId = 0)
    {
        qbdsTable = _dsJour.query().dataSourceTable(_jourTableId);

        if (_agreementFieldId && customJournalTable.AgreementHeaderExt)
        {
            if (_jourTableId == tableNum(PurchTable))
            {
                qbdsPurchTable_RU = _dsJour.query().dataSourceTable(tableNum(PurchTable_RU));
                if (qbdsPurchTable_RU)
                {
                    qbdsPurchTable_RU.joinMode(JoinMode::InnerJoin);
                    qbdsPurchTable_RU.addRange(_agreementFieldId).value(queryValue(customJournalTable.AgreementHeaderExt));
                }
            }
            else
            {
                qbdsTable.addRange(_agreementFieldId).value(queryValue(customJournalTable.AgreementHeaderExt));
            }
        }

        addPartnerInventRanges(_dsJour,
                               _dsTrans,
                               _jourTableId,
                               _transTableId,
                               _accountFieldId,
                               _inventTransIdFieldId);

        qbdsInventTrans = _dsTrans.query().dataSourceTable(tablenum(InventTrans));
        addInventDimSource(qbdsInventTrans, fieldnum(InventTrans, InventDimId));

        qbdsInventTrans = _dsJour.query().dataSourceTable(tablenum(InventTrans));
        addInventDimSource(qbdsInventTrans, fieldnum(InventTrans, InventDimId));
    }

    void updateExportQuery(FormDataSource  _dsJour,
                           FormDataSource  _dsTrans,
                           tableId         _jourTableId,
                           fieldId         _accountFieldId,
                           fieldId         _inventTransIdFieldId,
                           fieldId         _dateFieldId)
    {
        boolean noReturnInventTrans;

        if (customJournalType  == CustomJournalType_RU::Export &&
            invoicePostingType == SalesInvoicePostingType_RU::Standard)
        {
            noReturnInventTrans = true;
        }
        qbdsTable = query.dataSourceTable(_jourTableId);
        qbdsTable.addRange(_accountFieldId).value(queryValue(customJournalTable.PartnerCode));
        qbdsTable.addRange(_dateFieldId).value(strfmt('..%1', customJournalTable.PlanArrivalDate));

        qbdsInventTrans = query.dataSourceTable(tablenum(InventTrans));
        setInventTransRange(true, noReturnInventTrans);

        _dsJour.query(query);

        qbdsInventTransOrigin = inventTransOrigin_ds.query().dataSourceTable(tablenum(InventTransOrigin));
        qbdsInventTransOrigin.clearLinks();
        qbdsInventTransOrigin.addLink(_inventTransIdFieldId, fieldnum(InventTransOrigin, InventTransId), _dsTrans.name());

        qbdsInventTrans = inventTrans_ds.query().dataSourceTable(tablenum(InventTrans));
        setInventTransRange(true, noReturnInventTrans);
    }
    ;

    if (!dimAttrRecId)
    {
        return;
    }

    if (customJournalType == CustomJournalType_RU::Export)
    {
        rangeValueIssue = con2Str(customJournalTransCreate.getInventStatusIssueList());

        switch (invoicePostingType)
        {
            case SalesInvoicePostingType_RU::Standard :
                query = new Query(querystr(CustomJourExpStdCreate_RU));

                updateExportQuery(custPackingSlipJour_ds,
                                  custPackingSlipTrans_ds,
                                  tablenum(CustPackingSlipJour),
                                  fieldnum(CustPackingSlipJour, InvoiceAccount),
                                  fieldnum(CustPackingSlipTrans, InventTransId),
                                  fieldnum(CustPackingSlipJour, DeliveryDate));

                linkRange = qbdsInventTrans.addRange(fieldNum(InventTrans, RecId));
                linkRange.value(strFmt('((%1 == %2.%3))',
                                       fieldStr(InventTrans, PackingSlipId),
                                       custPackingSlipTrans_ds.name(),
                                       fieldStr(CustPackingSlipTrans, PackingSlipId)));

                qbdsTable = query.dataSourceTable(tablenum(SalesTable_RU));
                if (customJournalTable.AgreementHeaderExt)
                {
                    findOrCreateRange_W(qbdsTable, fieldnum(SalesTable_RU, AgreementHeaderExt_RU), queryValue(customJournalTable.AgreementHeaderExt));
                }
                break;

            case SalesInvoicePostingType_RU::GoodsInRoute :
                query = new Query(querystr(CustomJourExpGITCreate_RU));

                updateExportQuery(custInvoiceJour_ds,
                                  custInvoiceTrans_RU_ds,
                                  tablenum(CustInvoiceJour),
                                  fieldnum(CustInvoiceJour, InvoiceAccount),
                                  fieldnum(CustInvoiceTrans_RU, InventTransIdDelivery_RU),
                                  fieldnum(CustInvoiceJour, InvoiceDate));

                if (customJournalTable.AgreementHeaderExt)
                {
                    SysQuery::addDimensionAttributeRange(query,
                        query.dataSourceTable(tableNum(CustInvoiceJour)).name(),
                        fieldStr(CustInvoiceJour, DefaultDimension),
                        DimensionComponent::DimensionAttribute,
                        AgreementHeaderExt_RU::find(customJournalTable.AgreementHeaderExt).AgreementId,
                        DimensionAttribute::find(dimAttrRecId).Name);
                }
                break;
        }
    }
    else
    if (customJournalType == CustomJournalType_RU::Import)
    {
        rangeValueReceipt = con2Str(customJournalTransCreate.getInventStatusReceiptList());
        switch (customInventTransStatus)
        {
            case CustomInventTransStatus_RU::Ordered :
                addPartnerInventAgreementRanges(purchTable_ds,
                                               purchLine_ds,
                                               tablenum(PurchTable),
                                               tablenum(PurchLine),
                                               fieldnum(PurchTable, InvoiceAccount),
                                               fieldnum(PurchLine, InventTransId),
                                               fieldnum(PurchTable_RU, AgreementHeaderExt_RU));
                break;

            case CustomInventTransStatus_RU::Purchased :
                addPartnerInventAgreementRanges(vendInvoiceJour_ds,
                                               vendInvoiceTrans_ds,
                                               tablenum(VendInvoiceJour),
                                               tablenum(VendInvoiceTrans),
                                               fieldnum(VendInvoiceJour, InvoiceAccount),
                                               fieldnum(VendInvoiceTrans, InventTransId));

                if (customJournalTable.AgreementHeaderExt)
                {
                    SysQuery::addDimensionAttributeRange(vendInvoiceJour_ds.query(),
                        vendInvoiceJour_ds.name(),
                        fieldStr(VendInvoiceJour, DefaultDimension),
                        DimensionComponent::DimensionAttribute,
                        AgreementHeaderExt_RU::find(customJournalTable.AgreementHeaderExt).AgreementId,
                        DimensionAttribute::find(dimAttrRecId).Name);
                }
                break;
        }
    }
}

public boolean validateOK()
{
    Object              fdsObject;
    Common              currentRecord;
    Qty                 selectedQty, availableQty;
    PdsCWInventQty      pdsCWSelectedQty, pdsCWAvailableQty;
    ItemId              itemId;
    UnitOfMeasureSymbol unitId;

    boolean ret = true;

    if (tabPageCustInvoice.visible())
    {
        availableQty = inventTrans_ds.qtyAvailable(inventTrans, false);
        selectedQty = inventTrans_ds.qtyEdit(false, inventTrans, 0.0);
        pdsCWAvailableQty = inventTrans_ds.pdsCWQtyAvailable(inventTrans, false);
        pdsCWSelectedQty = inventTrans_ds.pdsCWQtyEdit(false, inventTrans, 0.0);

        itemId = inventTrans.ItemId;

        fdsObject       = inventTrans_ds;
        currentRecord   = InventTrans;
    }

    if (tabPageCustPackingSlip.visible())
    {
        availableQty = inventTrans_ds.qtyAvailable(inventTrans, false);
        selectedQty = inventTrans_ds.qtyEdit(false, inventTrans, 0.0);
        pdsCWAvailableQty = inventTrans_ds.pdsCWQtyAvailable(inventTrans, false);
        pdsCWSelectedQty = inventTrans_ds.pdsCWQtyEdit(false, inventTrans, 0.0);

        itemId = inventTrans.ItemId;

        fdsObject       = inventTrans_ds;
        currentRecord   = InventTrans;
    }

    if (tabPagePurch.visible())
    {
        availableQty = purchLine_ds.qtyAvailable(purchLine, false);
        selectedQty = purchLine_ds.qtyEdit(false, purchLine, 0.0);
        pdsCWAvailableQty = purchLine_ds.pdsCWQtyAvailable(purchLine, false);
        pdsCWSelectedQty = purchLine_ds.pdsCWQtyEdit(false, purchLine, 0.0);

        itemId = purchLine.ItemId;

        fdsObject       = purchLine_ds;
        currentRecord   = purchLine;
    }

    if (tabPageVendInvoice.visible())
    {
        availableQty = vendInvoiceTrans_ds.qtyAvailable(vendInvoiceTrans, false);
        selectedQty = vendInvoiceTrans_ds.qtyEdit(false, vendInvoiceTrans, 0.0);
        pdsCWAvailableQty = vendInvoiceTrans_ds.pdsCWQtyAvailable(vendInvoiceTrans, false);
        pdsCWSelectedQty = vendInvoiceTrans_ds.pdsCWQtyEdit(false, vendInvoiceTrans, 0.0);

        itemId = vendInvoiceTrans.ItemId;

        fdsObject       = vendInvoiceTrans_ds;
        currentRecord   = vendInvoiceTrans;
    }

    if (!fdsObject.marked(false, currentRecord, NoYes::No))
    {
        return true;
    }

    unitId = InventTableModule::find(itemId, ModuleInventPurchSales::Invent).UnitId;

    ret = element.validateQty(selectedQty,
                              fdsObject as FormDataSource,
                              currentRecord,
                              unitId,
                              pdsCWSelectedQty,
                              selectedQty != availableQty || pdsCWSelectedQty != pdsCWAvailableQty,
                              false);

    if (ret && PdsGlobal::pdsIsCWItem(itemId) && (selectedQty != availableQty || pdsCWSelectedQty != pdsCWAvailableQty))
    {
        ret = PdsCatchWeight::validateInventQty(itemId, availableQty - selectedQty, pdsCWAvailableQty - pdsCWSelectedQty);
    }

    if (!ret)
    {
        if (PdsGlobal::pdsIsCWItem(itemId))
        {
            pdsCWAvailableQty = fdsObject.pdsCWQtyAvailable(currentRecord, false);
            if (pdsCWAvailableQty < 0.0)
            {
                pdsCWAvailableQty = 0.0;
            }
            fdsObject.pdsCWQtyEdit(true, currentRecord, pdsCWAvailableQty);
        }
        else
        {
            availableQty = fdsObject.qtyAvailable(currentRecord, false);
            if (availableQty < 0.0)
            {
                availableQty = 0.0;
            }
            fdsObject.qtyEdit(true, currentRecord, availableQty);
        }
    }

    return ret;
}

/// <summary>
/// Validates quantities selected for processing.
/// </summary>
/// <param name="_qty">
/// Quantity selected for processing in inventory unit of measure.
/// </param>
/// <param name="_formDataSource">
/// The source document line form data source.
/// </param>
/// <param name="_record">
/// The source document line record.
/// </param>
/// <param name="_unitId">
/// Inventory unit of measure.
/// </param>
/// <param name="_pdsCWQty">
/// Quantity in Catch Weight unit of measure; optional.
/// </param>
/// <param name="_checkQtyMatching">
/// A Boolean determining whether to check whether inventory quantity matches provided CW quantity; optional.
/// </param>
/// <param name="_ignoreCheckQtyMatchingResult">
/// A Boolean determining whether to ignore results of the quantity matching check; optional.
/// </param>
/// <returns>
/// A Boolean determining whether validation succeeded.
/// </returns>
boolean validateQty(Qty                 _qty,
                    FormDataSource      _formDataSource,
                    Common              _record,
                    UnitOfMeasureSymbol _unitId,
                    PdsCWInventQty      _pdsCWQty = 0.0,
                    boolean             _checkQtyMatching = true,
                    boolean             _ignoreCheckQtyMatchingResult = true)
{
    boolean         ret                  = true;
    Object          objectFormDataSource = _formDataSource;
    FieldId         itemFieldId          = fieldName2Id(_record.TableId, fieldStr(InventTable, ItemId));
    InventTable     inventTable          = InventTable::find(_record.(itemFieldId));
    boolean         pdsIsCWItem          = PdsGlobal::pdsIsCWItem(inventTable.ItemId);
    boolean         inventQtyCorrelates2CWQty;
    Qty             qtyAvailable;
    PdsCWInventQty  pdsCWQtyAvailable;

    if (_record                                             &&
        itemFieldId                                         &&
        _qty                                                &&
        customJournalType == CustomJournalType_RU::Import   &&
        ! EcoResTrackingDimGroupSetup::newDimensionGroup(inventTable.trackingDimensionGroup()).getFieldSetup(fieldNum(InventDim, InventGtdId_RU)).isActive())
    {
        ret = checkFailed(strfmt("@GLS115926", _record.(itemFieldId), fieldid2pname(tablenum(InventDim), fieldnum(InventDim, InventGtdId_RU))));
    }

    if (pdsIsCWItem)
    {
        if (formDataSourceHasMethod(_formDataSource, identifierStr(pdsCWQtyAvailable)))
        {
            pdsCWQtyAvailable = objectFormDataSource.pdsCWQtyAvailable(_record, false);
        }
    }

    if (formDataSourceHasMethod(_formDataSource, identifierstr(qtyAvailable)))
    {
        qtyAvailable = objectFormDataSource.qtyAvailable(_record, false);
    }

    if ((pdsIsCWItem
     && _pdsCWQty > pdsCWQtyAvailable)
     || _qty > qtyAvailable)
    {
        checkFailed("@GLS115441");

        if (( pdsIsCWItem
         &&  _pdsCWQty > pdsCWQtyAvailable)
         || ((!pdsIsCWItem || (_checkQtyMatching && !_ignoreCheckQtyMatchingResult))
         &&  _qty > qtyAvailable))
        {
            ret = false;
        }
    }

    if (_qty < 0 || (pdsIsCWItem && _pdsCWQty < 0))
    {
        ret = checkFailed("@GLS115442");
    }

    if (_qty != roundUpDec(_qty, UnitOfMeasure::findBySymbol(_unitId).DecimalPrecision))
    {
        ret = checkFailed(strfmt("@GLS115443", _unitId, UnitOfMeasure::findBySymbol(_unitID).DecimalPrecision));
    }

    if (pdsIsCWItem && _pdsCWQty != roundUpDec(_pdsCWQty, 0))
    {
        ret = checkFailed(strfmt("@GLS115443", PdsCatchWeight::cwUnitId(inventTable.ItemId), 0));
    }

    if (pdsIsCWItem && _checkQtyMatching)
    {
        inventQtyCorrelates2CWQty = PdsCatchWeight::validateInventQty(inventTable.ItemId, _qty, _pdsCWQty);
        if (!_ignoreCheckQtyMatchingResult)
        {
            ret = ret && inventQtyCorrelates2CWQty;
        }
    }

    return ret;
}

