public boolean leave()
{
    boolean         ret;
    boolean         isQtyValid = true;
    Qty             availableQty, selectedQty;
    PdsCWInventQty  pdsCWAvailableQty, pdsCWSelectedQty;
    PurchLine       purchLineLocal = purchLine.data();

    ret = super();

    if (this.marked(false, purchLineLocal, NoYes::No) && PdsGlobal::pdsIsCWItem(purchLineLocal.ItemId))
    {
        pdsCWAvailableQty = this.pdsCWQtyAvailable(purchLineLocal, false);
        pdsCWSelectedQty = this.pdsCWQtyEdit(false, purchLineLocal, 0.0);
        availableQty = this.qtyAvailable(purchLineLocal, false);
        selectedQty = this.qtyEdit(false, purchLineLocal, 0.0);

        isQtyValid = element.validateQty(selectedQty,
                                         this,
                                         purchLineLocal,
                                         InventTableModule::find(purchLineLocal.ItemId, ModuleInventPurchSales::Invent).UnitId,
                                         pdsCWSelectedQty,
                                         selectedQty != availableQty || pdsCWSelectedQty != pdsCWAvailableQty,
                                         false);

        if (isQtyValid && (selectedQty != availableQty || pdsCWSelectedQty != pdsCWAvailableQty))
        {
            isQtyValid = PdsCatchWeight::validateInventQty(purchLineLocal.ItemId,
                                                           availableQty - selectedQty,
                                                           pdsCWAvailableQty - pdsCWSelectedQty);
        }

        ret = isQtyValid && ret;
    }

    return ret;
}

