{
    int ret;
    boolean isCWEnabled;

    ret = super();

    isCWEnabled = PdsGlobal::pdsIsCWItem(purchLine.ItemId);

    PurchLine_pdsCWQtyEdit.allowEdit(isCWEnabled);
    qtyEditPurchLine.allowEdit(!isCWEnabled);

    return ret;
}

edit PdsCWInventQty pdsCWQtyEdit(boolean        _set,
                                 PurchLine      _purchLine,
                                 PdsCWInventQty _pdsCWQty)
{
    PdsCWInventQty  pdsCWQty;
    Qty             qty;

    if (_set && _pdsCWQty < 0)
    {
        return 0;
    }

    if (_set)
    {
        qty = this.qtyEdit(false, _purchLine, 0.0);
    }

    pdsCWQty = conPeek(element.editQtyPacked(_set,
                                             _purchLine,
                                             _purchLine.PurchId,
                                             _purchLine.ItemId,
                                             any2real(_purchLine.LineNumber),
                                             DateTimeUtil::getSystemDate(DateTimeUtil::getUserPreferredTimeZone()),
                                             purchLine_ds,
                                             qty,
                                             InventTableModule::find(_purchLine.ItemId, ModuleInventPurchSales::Invent).UnitId,
                                             _pdsCWQty),
                       posPdsCWQty);

    return pdsCWQty;
}

