public void init()
{
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]))
    {
        // Switch the link type as fields appear in the grid that require an outerjoin
        this.linkType(FormLinkType::OuterJoin);
    }

    super();
}

